import React, {Fragment} from 'react';
import { useHistory } from 'react-router-dom';

function erreur404(){
    let history = useHistory();

    return(
        <Fragment>
            <div>
                ERREUR 404 !!!!
            </div>
            <button onClick={() => history.push('/')}>Go t</button>
        </Fragment>
    )
}

export default erreur404
